import React from 'react';
import '../styles/AboutUs.scss';

function AboutUs({ language }) {
    return (
        <section className="aboutus-section" id="about">
            <h1 className="about-us-title">
                {language === 'EN' ? 'ABOUT US' : 'À PROPOS'}
            </h1>
            <p className="about-us-description">
                {language === 'EN'
                    ? `Our family created with passion Nature Sculpt 
                    twenty years ago. Our passion for plants and trees made us 
                    decide to share our 
                    knowledge and skills with the public. Our team is composed of a 
                    landscaping architect, an agronomist, an irrigation expert, a garden maintenance specialist, 
                    a team of experienced gardeners and an administrative service.`
                    : `Notre famille a créé avec passion Nature Sculpt 
                    il y a vingt ans. Notre passion pour les plantes et les arbres 
                    nous a amenés à partager nos 
                    connaissances et compétences avec le public. Notre équipe est composée d'un 
                    architecte paysagiste, d'un agronome, d'un expert en irrigation, d'un spécialiste de l'entretien des jardins, 
                    une équipe de jardiniers expérimentés et d'un service administratif.`}
            </p>
        </section>
    );
}

export default AboutUs;
